import React from 'react';
import s from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = () => {
    return (

            <div>
                New post
                <div className={s.newPost}>
                    <textarea></textarea>
                    <button>Add</button>
                    <button>Cancel</button>
                </div>
                <div className={s.posts}>
                    My posts
                    <Post name='salam'/>
                    <Post name='popolam'/>
                    <Post name='dont care'/>
                    <Post name='im an asshole'/>
                    <Post name='blablablla'/>
                </div>
            </div>

    );
}

export default MyPosts;
